import React, { useState } from "react";
import styled from "styled-components";

function Categorias() {
  const [categorias] = useState([
    "Inspira√ß√£o",
    "Leituras",
    "Games",
    "Filmes",
    "S√©ries",
    "Animes",
    "Mang√°s",
    "Reflex√µes",
    "Ideias Soltas",
    "Criatividade",
    "DevLogs",
    "Random",
    "Pessoal"
  ]);

  const [filtro, setFiltro] = useState("");
  const [categoriaSelecionada, setCategoriaSelecionada] = useState(null);

  const categoriasFiltradas = categorias.filter((cat) =>
    cat.toLowerCase().includes(filtro.toLowerCase())
  );

  // Posts de exemplo (voc√™ pode substituir depois com os reais)
  const postsFakes = {
    Inspira√ß√£o: ["Seja sua melhor vers√£o", "Amanh√£ pode ser incr√≠vel"],
    Leituras: ["Resenha: A Revolu√ß√£o dos Bichos", "O que estou lendo em 2025"],
    Games: ["Top 5 jogos do m√™s", "Como zerei Hollow Knight"],
    Filmes: ["Review: Duna Parte 2", "Cl√°ssicos que amo"],
    S√©ries: ["A nova temporada de Stranger Things", "Minhas favoritas da Netflix"],
    Animes: ["Recomenda√ß√µes para iniciantes", "Review de Jujutsu Kaisen"],
    Mang√°s: ["One Piece cap√≠tulo 1090", "Lendo Tokyo Ghoul de novo"],
    Reflex√µes: ["Quem eu era h√° 5 anos", "Tempo e identidade"],
    "Ideias Soltas": ["Projeto aleat√≥rio #1", "Pensamentos de madrugada"],
    Criatividade: ["Meu processo criativo", "Como combato bloqueios"],
    DevLogs: ["Progresso do meu blog em React", "Melhorias no backend"],
    Random: ["Coisas que me fazem sorrir", "Achei isso engra√ßado demais"],
    Pessoal: ["Anivers√°rio da minha cachorra üê∂", "Desabafo sincero"]
  };

  return (
    <XPWindow>
      <TitleBar>
        <h2>Pesquise uma Categoria</h2>
        <InputArea>
          <input
            type="text"
            placeholder="Digite o nome da categoria"
            value={filtro}
            onChange={(e) => setFiltro(e.target.value)}
          />
        </InputArea>
      </TitleBar>

      <CategoriaLista>
        {categoriasFiltradas.map((cat, index) => (
          <CategoriaBotao
            key={index}
            onClick={() => setCategoriaSelecionada(cat)}
          >
            {cat}
          </CategoriaBotao>
        ))}
      </CategoriaLista>

      {categoriaSelecionada && (
        <PostsArea>
          <h3>Posts em "{categoriaSelecionada}"</h3>
          <ul>
            {(postsFakes[categoriaSelecionada] || []).map((post, idx) => (
              <li key={idx}>{post}</li>
            ))}
          </ul>
        </PostsArea>
      )}
    </XPWindow>
  );
}

const XPWindow = styled.div`
  max-width: 700px;
  margin: 40px auto;
  border: 2px solid #000;
  background-color: #e0e0e0;
  box-shadow: inset -2px -2px #fff, inset 2px 2px #808080;
  font-family: 'Press Start 2P', monospace;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
`;

const TitleBar = styled.div`
  background-color: purple;
  color: white;
  padding: 20px;
  font-size: 20px;
  border-bottom: 2px solid #000;
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 15px;

  h2 {
    margin: 0;
    font-size: 16px;
    text-align: center;
  }
`;

const InputArea = styled.div`
  display: flex;
  width: 100%;
  justify-content: center;

  input {
    padding: 8px;
    width: 250px;
    font-family: 'Press Start 2P', monospace;
    font-size: 10px;
    border: 2px solid #000;
    background-color: #fff;
  }
`;

const CategoriaLista = styled.div`
  margin-top: 30px;
  display: flex;
  flex-wrap: wrap;
  gap: 10px;
  justify-content: center;
`;

const CategoriaBotao = styled.button`
  background-color: #fff;
  padding: 8px 12px;
  border: 2px solid #000;
  box-shadow: 2px 2px #808080;
  font-size: 10px;
  color: purple;
  cursor: pointer;
  font-family: 'Press Start 2P', monospace;

  &:hover {
    background-color: #f0f0f0;
  }
`;

const PostsArea = styled.div`
  margin-top: 40px;
  width: 100%;
  border-top: 2px solid #000;
  padding-top: 20px;

  h3 {
    font-size: 14px;
    color: purple;
    text-align: center;
    margin-bottom: 15px;
  }

  ul {
    list-style: none;
    padding-left: 0;
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 8px;
  }

  li {
    background: #fff;
    padding: 10px 14px;
    border: 2px solid #000;
    box-shadow: 2px 2px #808080;
    font-size: 10px;
    width: 80%;
    text-align: center;
  }
`;

export default Categorias;
